import Navbar from "./Components/navbar";
import Card from "./Components/Card";
import React,{ Component } from 'react';
import california from "./images/california.png"
import dragon from "./images/dragon.png"
import dynamite from "./images/dynamite.png"
import logo from "./images/logo.png"
import philadelphia from "./images/philadelphia.png"
import rainbow from "./images/rainbow.png"
import shrimp from "./images/shrimp.png"

class App extends Component {
  state ={
    cards:[
      {id:0,Nome:"california",Prezzo:1.99,img:california},
      {id:1,Nome:"dragon",Prezzo:0.99,img:dragon},
      {id:2,Nome:"dynamite",Prezzo:2.39,img:dynamite},
      {id:3,Nome:"logo",Prezzo:1.69,img:logo},
      {id:4,Nome:"philadelphia",Prezzo:2.59,img:philadelphia},
      {id:5,Nome:"rainbow",Prezzo:0.69,img:rainbow},
      {id:6,Nome:"shrimp",Prezzo:1.29,img:shrimp},
    ]
  }
  render(){
  return (
  <>
  <Navbar/>
   <div className="container">
    <h1>Cosa desideri ordinare ?</h1>
    <hr/>
    <div className="row">
         {this.state.cards.map(card=>{
          <Card
           key={card.id}
           Nome={card.Nome}
           Prezzo={card.Prezzo}
           img={card.img}
          />
          })
          }
    </div>
   </div>
  </>

  );}
}


export default App;
